#get best Scores per Columns
def max4title(df,col,title):
    maximum=0
    for index, row in df.iterrows():
        s=float(row["Score"])
        isTitle=row[col]
        if isTitle==title and s>maximum:
            maximum=s

    return maximum

def best4col (df,col):
    b=[]
    a=df[col].unique()
    for i in a:
        maxi=max4title(df,col,i)
        b.append(maxi)

    return b
